boolean HTTPmsg__PT_BASE::process_message(const char *message_type, Text_Buf& incoming_buf, component sender_component, OCTETSTRING&)
{
if (!strcmp(message_type, "@HTTPmsg_Types.Connect_result")) {
HTTPmsg__Types::Connect__result incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.Client_connected")) {
HTTPmsg__Types::Client__connected incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.Listen_result")) {
HTTPmsg__Types::Listen__result incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.Close")) {
HTTPmsg__Types::Close incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.Half_close")) {
HTTPmsg__Types::Half__close incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.Shutdown")) {
HTTPmsg__Types::Shutdown incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else if (!strcmp(message_type, "@HTTPmsg_Types.HTTPMessage")) {
HTTPmsg__Types::HTTPMessage incoming_par;
incoming_par.decode_text(incoming_buf);
incoming_message(incoming_par, sender_component);
return TRUE;
} else return FALSE;
}


